`,o.jsx(n.p,{children:"This guide is tailored for computer science undergraduates with limited Generative AI experience who want to build practical generative AI skills and earn the Google Skill Badge. It provides a clear, encouraging path from fundamentals to earning the Skill Badge, emphasizing hands-on projects and responsible AI practices. By following these steps, you'll gain experience with Google’s AI tools (like Vertex AI and PaLM) and create a portfolio that shows your curiosity and initiative to recruiters."}),`
`,o.jsxs(n.p,{children:[o.jsx(n.strong,{children:"Skill Badge:"})," Google Cloud skill badges are digital credentials issued by Google Cloud in recognition of your knowledge of Google Cloud products and services. You can earn skill badges on Google Cloud Skills Boost and can share their skill badge to your social media profile and resume. Add manually as “License & Certifications” on LinkedIn or use ",o.jsx(n.a,{href:"https://www.youtube.com/watch?v=ZFAuWCEOxbw&t=392s",children:"Credly"}),", and add to your resume under Certification section. As noted, not all learning paths offer skill badges."]}),`
`,o.jsxs(n.p,{children:[o.jsx(n.strong,{children:"Do you really need a badge?"})," That’s for you to decide based on your goals. Most recruiters care far more about the project you create than a badge. Plus completing all the steps for a badge will take many hours of time. If your goal is to complete a project in a timely manner for your resume, then feel free to pick and choose which steps to complete in this document. You can always complete the badge later."]}),`
`,o.jsx(n.h2,{children:"Why take the time to build these skills?"}),`
`,o.jsx(n.p,{children:"In the hypercompetitive tech job market, it is important to ensure that you are doing everything that you can to stand out as an applicant. By taking the time to build projects using recent advances in generative AI technology, you demonstrate new competencies aligned with software engineering job requirements. By taking the time to achieve skill badges and certifications, you showcase curiosity and the ambition to go above and beyond your coursework."}),`
`,o.jsx(n.h3,{children:"Why GenAI?"}),`
`,o.jsx(n.p,{children:"From a software developer’s perspective, the key difference between traditional AI/ML and generative AI is what the model produces. Conventional machine learning models are designed to analyze data — they classify, detect, or predict based on patterns in existing datasets. For example, predicting housing prices or recognizing whether an image contains a cat."}),`
`,o.jsxs(n.p,{children:["Generative AI goes a step further: it creates. These models generate entirely new content—text, images, code, music—by learning from vast amounts of data. ",o.jsx(n.strong,{children:"That means developers aren’t just building systems that analyze information—they’re building systems that create it."})," Large language models (LLMs), diffusion models, and multimodal transformers can now write essays, generate front-end code from prompts, design images, or simulate dynamic conversations."]}),`
`,o.jsx(n.p,{children:"This unlocks a new class of applications—and development becomes faster and more flexible. Instead of spending weeks writing boilerplate or tuning algorithms from scratch, you can prototype working features with just a few API calls to tools like Google’s Vertex AI or OpenAI’s APIs. It is important to understand both the concepts behind these tools and how to use them."}),`
`,o.jsxs(n.p,{children:[o.jsx(n.em,{children:o.jsx(n.strong,{children:"Generative AI is a game changer"})})," because it dramatically shortens the path from idea to implementation. Learning how to use these models isn't just optional—it’s essential if you want to stay competitive in today’s rapidly evolving software landscape. Recruiters for entry-level roles aren’t expecting you to be a generative AI expert, but they do look for initiative, coding ability, and hands-on project experience. By following this generative AI learning path, you’ll be able to:"]}),`
