`,o.jsxs(n.li,{children:[o.jsx(n.strong,{children:"Document Q&A Chatbot with Retrieval:"})," Build a chatbot that can answer questions based on your own documents (like class notes, research papers, or manuals). This project introduces you to retrieval-augmented generation (RAG)—a popular technique that grounds a model's output in real data to improve accuracy and reduce hallucinations. You'll learn how to split documents into chunks, generate embeddings, store them in a vector database, and retrieve relevant text for a user's query before passing it to a language model.",`
