`,o.jsx(n.p,{children:"Each of these projects uses Google's generative AI tools and comes with community or official guidance. They are excellent for learning because they expose you to different facets of generative AI (text, images, retrieval, conversation). As always, when following a tutorial, don't just copy code – try to understand it and experiment with tweaks. Often, it can be easy to passively learn these new concepts. Make sure that you're understanding every line of code- whether this is trying to build your own project and not following a tutorial, or having ChatGPT or Copilot explain every line of code."}),`
